import React, { Component } from 'react';
import './MenuItems.css';
import { IoIosAdd,IoMdPerson } from "react-icons/io";
import MenuItem from './MenuItem/MenuItem';
import { IconContext } from "react-icons";
const MenuItems=()=>{
    return(
<ul className="MenuItems">
       <MenuItem link="/" >
        سبد خرید
       </MenuItem>
       <MenuItem link="/" >
       <IconContext.Provider
      value={{ color: '#ffffff', size: '30px' }}>
      <span style={{marginTop:10}} > <IoMdPerson /></span>
    </IconContext.Provider>
           <span>ورود</span>
       </MenuItem>
       <MenuItem link="/" >
       <IconContext.Provider
      value={{ color: '#ffffff', size: '30px' }}>
      <span style={{marginTop:10}} > <IoIosAdd /></span>
    </IconContext.Provider>
           <span>ثبت نام</span>
       </MenuItem>
   
      

       {/* <MenuItem link="/add-student" 
       link={{
           pathname:"/add-student",
           search:"?sort-name",
           hash:"#the-hash",
           state:{fromDashboard:true}
       }}
       >
       اضافه کردن نام دانش آموز
       </MenuItem> */}
    
    </ul>
    )
    
}
export default MenuItems;
